import React from "react";
import { motion } from "framer-motion";

const ReviewsLeft = () => {
  return (
    <motion.div
      initial={{ opacity: 0, y: 40 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.5 }}
      className="w-full max-w-xl mx-auto mt-24 bg-white/90 rounded-2xl shadow-2xl p-10"
    >
      <h2 className="text-2xl font-bold mb-6 text-green-800">Reviews Left</h2>
      <p className="text-gray-600 mb-4">(User reviews UI coming soon...)</p>
    </motion.div>
  );
};

export default ReviewsLeft;
